  render (){
    return(
      //-----------------------------------
        <div className="App">
          <header className="App-header">
            <img src={logo} className="App-logo" alt="logo" />
            <p>
              My name is Ruben
            </p>
            <button>Change Name</button>
          </header>
        </div>

      //-----------------------------------
    );
  }
}

export default App
